function productExceptSelf(nums: number[]): number[] {
    const products: number[] = [], l: number[] = [], r: number[] = [];
    for (let i = 0; i < nums.length; i++) {
        if (i === 0) {
            l[i] = 1;
            r[nums.length - 1 - i] = 1
        }
        else {
            l[i] = l[i - 1] * nums[i - 1];
            r[nums.length - 1 - i] = r[nums.length - i] * nums[nums.length - i];
        }
    }
    for (let i = 0; i < nums.length; i++) {
        products[i] = l[i] * r[i]
    }
    return products
};

function productExceptSelfOld(nums: number[]): number[] {
    const products = [];
    for (let i = 0; i < nums.length; i++) {
        let product = 1;
        for (let j = 0; j < nums.length; j++) {
            if (j == i) continue;
            product *= nums[j]
        }
        products[i] = product
    }
    return products
};

